import React from "react";
import { Component } from "react";

class Deals extends Component {
    render() {
        return (
            <div>
                <ul class="nav justify-content-center">
                    <li class="nav-item">
                        <a class="nav-link active" aria-current="page" href="#">Active Deals</a>
                    </li>
                    <li class="nav-item">
                        <a class="nav-link" href="#">Past Deals</a>
                    </li>
                </ul>

            </div>
        )
    }
}

export default Deals;
